import requestJS from "../utils/request";
import ajax from "../utils/ajax";

export const login = data => requestJS("./login", {
    data
})

// export const booksSearch = data => requestJS("http://82.156.102.187:8001/api/search/", {
//     data
// })

export const booksSearch = data => ajax({
    url: "http://82.156.102.187:8001/api/search/",
    data,
    success: data => {
        console.log(data);
    },
    error: err => {
        console.log(err);
    } 
})
